import React from 'react';
import ExpenseItem from './ExpenseItem';
const ExpenseList=(props)=>{
    return(
        <div>
            <ExpenseItem name={props.expenseData[0].name} date={props.expenseDate[0].date}/>
            <ExpenseItem name={props.expenseData[1].name} date={props.expenseDate[1].date}/>
        </div>
    )
}
export default ExpenseList;
